var config = {
    title: "Interaction_details_popup",
};

function handleCommunicationEvent(context) {
    //console.log("Communication from NV_SOFTPHONE");
    //console.log("Communication from NV_SOFTPHONE", context);
    if (context.type == "Interaction_DATA") {
        console.log("InteractionIdRecordingRecieved", context);
    }
}

function initSuccess(snConfig) {
    console.log("Novelvox >>>> openframe configuration", snConfig);
    //register for communication event from TopFrame
    openFrameAPI.subscribe(openFrameAPI.EVENTS.COMMUNICATION_EVENT,
        handleCommunicationEvent);

}

function initFailure(error) {
    console.log("Novelvox >>>> OpenFrame init failed..", error);
}
openFrameAPI.init(config, initSuccess, initFailure);

